        public bool FindDriver(Dictionary<string, string> deviceInfo, out string updateUrl, out string msgType)
        {
            bool flag = false;
            updateUrl = "";
            msgType = "";
            string text = deviceInfo["os_version"].ToLowerInvariant();
            string arg = deviceInfo["os_arch"].ToLowerInvariant();
            string arg2 = deviceInfo["processor_vendor"].ToLowerInvariant();
            string text2 = deviceInfo["processor"].ToLowerInvariant();
            string[] array = deviceInfo["gpu_vendor"].ToLowerInvariant().Split(new string[3]
			{
				Environment.NewLine,
				"\r\n",
				"\n"
			}, StringSplitOptions.RemoveEmptyEntries);
            string[] array2 = deviceInfo["gpu"].ToLowerInvariant().Split(new string[3]
			{
				Environment.NewLine,
				"\r\n",
				"\n"
			}, StringSplitOptions.RemoveEmptyEntries);
            string[] array3 = deviceInfo["driver_version"].ToLowerInvariant().Split(new string[3]
			{
				Environment.NewLine,
				"\r\n",
				"\n"
			}, StringSplitOptions.RemoveEmptyEntries);
            string[] array4 = deviceInfo["driver_date"].ToLowerInvariant().Split(new string[3]
			{
				Environment.NewLine,
				"\r\n",
				"\n"
			}, StringSplitOptions.RemoveEmptyEntries);
            int num = 0;
            bool flag2 = false;
            string text3 = "";
            string text4 = "";
            string text5 = "";
            string text6 = "";
            for (int i = 0; i < array.Length; i++)
            {
                if (array2[i].Contains("nvidia"))
                {
                    string filterExpression = "os_arch = '" + arg + "' AND gpu_vendor = '" + array[i] + "'";
                    DataRow[] array5 = this.graphicsDriverData.Select(filterExpression);
                    foreach (DataRow row in array5)
                    {
                        if (array2[i].Contains(this.GetRowData(row, Column.gpu)) && text.Contains(this.GetRowData(row, Column.os_version)))
                        {
                            Logger.Info("Found match");
                            flag2 = true;
                            int num2 = Convert.ToInt32(array4[i].Substring(0, 8));
                            int num3 = Convert.ToInt32(this.GetRowData(row, Column.driver_date));
                            if (num3 > num2)
                            {
                                Logger.Info("Found newer date");
                                flag = true;
                                int length = this.GetRowData(row, Column.gpu).Length;
                                if (length > num)
                                {
                                    num = length;
                                    text3 = this.GetRowData(row, Column.driver_version);
                                    string text7 = array[i];
                                    text4 = array2[i];
                                    text6 = this.GetRowData(row, Column.driver_date);
                                    text5 = this.GetRowData(row, Column.driver_url);
                                }
                            }
                            else if (num3 == num2)
                            {
                                text3 = this.GetRowData(row, Column.driver_version);
                                string text8 = array[i];
                                text4 = array2[i];
                                text6 = this.GetRowData(row, Column.driver_date);
                            }
                        }
                        else
                        {
                            Logger.Debug("No match");
                        }
                    }
                }
                else
                {
                    string filterExpression = "os_arch = '" + arg + "' AND processor_vendor = '" + arg2 + "' AND gpu_vendor = '" + array[i] + "'";
                    DataRow[] array6 = this.graphicsDriverData.Select(filterExpression);
                    foreach (DataRow row2 in array6)
                    {
                        if (array2[i].Contains(this.GetRowData(row2, Column.gpu)) && text.Contains(this.GetRowData(row2, Column.os_version)) && text2.Contains(this.GetRowData(row2, Column.processor_family)))
                        {
                            Logger.Info("Found match");
                            flag2 = true;
                            System.Version v = new System.Version(array3[i]);
                            System.Version v2 = new System.Version(this.GetRowData(row2, Column.driver_version));
                            if (v2 > v)
                            {
                                Logger.Info("Found newer version");
                                flag = true;
                                int num4 = this.GetRowData(row2, Column.gpu).Split(new char[1]
								{
									' '
								}, StringSplitOptions.RemoveEmptyEntries).Length;
                                if (num4 > num)
                                {
                                    num = num4;
                                    text3 = this.GetRowData(row2, Column.driver_version);
                                    string text9 = array[i];
                                    text4 = array2[i];
                                    text6 = this.GetRowData(row2, Column.driver_date);
                                    text5 = this.GetRowData(row2, Column.driver_url);
                                }
                            }
                            else if (v2 == v)
                            {
                                text3 = this.GetRowData(row2, Column.driver_version);
                                string text10 = array[i];
                                text4 = array2[i];
                                text6 = this.GetRowData(row2, Column.driver_date);
                            }
                        }
                        else
                        {
                            Logger.Debug("No match");
                        }
                    }
                }
            }
            if (flag)
            {
                Logger.Info("Found new driver");
                Logger.Info("GPU:{0}, Driver version: {1}, Driver URL: {2}, Driver Date: {3}", text4, text3, text5, text6);
                updateUrl = text5;
                msgType = "error";
