            }
            return flag;
        }

        private string GetRowData(DataRow row, Column column)
        {
            string result = "";
            try
            {
                result = (string)row[(int)column];
                return result;
            }
            catch (Exception ex)
            {
                Logger.Error(ex.ToString());
                return result;
            }
        }
